// src/pages/Welcome.js
import React from "react";
import Auth from "../components/Auth";  // Google認証ボタンを利用
import GoogleButton from 'react-google-button' //Goole認証ボタン
import "./Welcome.css";  // スタイルを適用するためのCSSファイル

const Welcome = () => {
  return (
    <div className="welcome-container">
      {/* 左半分：画像表示 */}
      <div className="welcome-image">
        <img 
          src="https://example.com/boxing-image.jpg"  // 適切な画像URLに置き換えてください
          alt="Boxing Match"
        />
      </div>

      {/* 右半分：タイトルと認証ボタン */}
      <div className="welcome-content">
        <h1>Boxing-App</h1>
        <p>対戦相手を見つけるにはGoogleでサインインしてください。</p>
        <Auth />  {/* Google認証ボタンの表示 */}
      </div>
    </div>
  );
};

export default Welcome;
